import React, { useState } from "react";
import "./styles.css";

var booksDictionary = {
  fiction: [
    {
      name: "Lord of the rings",
      rating: "9 / 10",
      imgLink:
        "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSgT8cVUq57gjkb2FusP3rZjbvVG4UQM28RqA&usqp=CAU"
    },
    {
      name: "Harry Potter Series",
      rating: "8.5 / 10",
      imgLink:
        "data:image/jpeg;base64,"
    }
  ],

  selfHelp: [
    {
      name: "You can Win",
      rating: "9 / 10",
      imgLink:
        "data:image/jpeg;base64,"
    },
    {
      name: "Rich Dad Poor Dad",
      rating: "8 / 10",
      imgLink:
        "data:image/jpeg;base64,"
    }
  ],

  computerScience: [
    {
      name: "Eloquent Javascript",
      rating: "9.3 / 10",
      imgLink:
        "data:image/jpeg;base64,"
    },
    {
      name: "The C programming language",
      rating: "9 / 10",
      imgLink:
        "data:image/jpeg;base64,"
    }
  ]
};

var booksWeHave = Object.keys(booksDictionary);

export default function App() {
  const [genreInput, setGenreInput] = useState("selfHelp");
  function genreHandler(genre) {
    setGenreInput(genre);
  }

  return (
    <div className="App">
      <h1>Must Read Books</h1>

      <div>
        {booksWeHave.map((genre) => (
          <button className="genre-button" onClick={() => genreHandler(genre)}>
            {genre}
          </button>
        ))}
      </div>

      <div style={{ textAlign: "left" }}>
        <ul style={{ paddingInlineStart: "0" }}>
          {booksDictionary[genreInput].map((book) => (
            <li className="book-list">
              <div className="book-name">{book.name}</div>

              <img className="image-book" src={book.imgLink} alt="book-cover" />
              <div className="book-rating">rating:{book.rating}</div>
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
}
